        } else {

        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }

    let handleObject = feature => {
        if (feature === null) {
            return '';
        } else if (typeof(feature)=='object') {
            return JSON.stringify(feature);
        } else {
            return feature;
        }
    }
    let fields = ["type", "track_number", "time_str", "lat", "lon", "effective_area", "inner_height"];
    let aliases = ["Type:", "Track #:", "Date:", "Lat:", "Lon:", "Area (km\u00b2):", "Height (m):"];
    let table = '<table>' +

        `<tr>
            <th>${aliases[i]}</th>
            
            <td>${handleObject(layer.feature.properties[v])}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
